import React, { Component } from 'react'
import { connect } from 'http2';
 class ProducList extends Component {
     render() {
          return (
               <div>
                 <h3>Products</h3>   
               </div>
          )
     }
}

function mapStateToProps(state) {
     return {
       currentCategory: state.changeCategoryReducer
     };
}
export default connect(
     mapStateToProps,
     mapDispatchToProps
     )(ProductList);
